import React from "react";
import { Link } from "react-router-dom";

const NotFound = () => {
  return (
    <div>
      <img
        style={{ width: "75%" }}
        src="https://miro.medium.com/max/1400/1*cLQUX8jM2bMdwMcV2yXWYA.jpeg"
        alt=""
      />

      <Link to="/">
        <button className="btn btn-success">GO Back</button>
      </Link>
    </div>
  );
};

export default NotFound;
